import React, { Component } from 'react'

export default class Sidenav extends Component {
    render() {

        return (
            <div className="side-nav">
                {import('./NavComponents').then(res=>{
            return res.NavComponents
        }).map(x=>{
            <li>{x.id}</li>
        })}
            </div>
        )
    }
}
